contracts/Apps/Multisig.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

contract MultiSigWallet {
  // events that are fired and need other owners to approve 
    event Deposit(address indexed sender, uint amount);
    event Submit(uint indexed txId);
    event Approve( address indexed owner, uint indexed txID);
    event Revoke( address indexed owner, uint indexed txID);
    event Execute(uint indexed txId);


    struct Transaction {
        address to; 
        uint value;
        bytes data;
        bool executed;
    }
 //statevariable owners
    address[] public owners;
    mapping(address => bool) public isOwner;
    uint public required; // number of addresses to agree to the transaction



    Transaction[] public trasactions;
    mapping(uint => mapping (address => bool)) public approved;

    modifier onlyOwner() {
        require(isOwner[msg.sender], "is not owner");
        _;
    }


    constructor (address[] memory _owner, uint _required){
        require(_owner.length > 0, "owners required");
        require(
            _required > 0 && _required <= _owner.length,
            "invalid required number of owners"
        );


        for (uint i; i < _owner.length; i++){
            address owner = _owner[i];
            require(owner != address(0), "invalid owner");
            require(!isOwner[owner], "owner is not unique");


            isOwner[owner] = true;
            owners.push(owner);

        }

        required = _required;
    }


    receive() external payable {
        emit Deposit(msg.sender, msg.value);
    }

    function submit(address _to, uint _value, bytes calldata _data)
        external 
        onlyOwner
    {

    }

}

